import React from 'react';
import classes from './Post.module.css';


const Post = (props) => {
	return <div className={classes.post}>
		<div className={classes.circle}></div>
		{props.message}
		<div className={classes.likesCount}>
			<span><img src='https://mywebicons.ru/i/png/51f90108518a04fc0e908215a009ff75.png' alt='like' width={20}></img></span>
			{props.likesCount}
		</div>
	</div>



}

export default Post
